import Img from "../src/images/Img.png"
import Common from "./common";

const About = () =>{
    return(
        <>
         <Common
         name = "welcome to about page"
         imgsrc = {Img}
         visit = "/contact"
         btn_name = "contact now!"
         />
        </>
    )
}

export default About;
